import React from "react";
import axios from "axios";
import styled from "styled-components";

const Wrapper = styled.div`
  display: flex;
  width: 100vw;
  height: 100vh;
  align-items: center;
  justify-content: center;
`;

function App() {
  return <Wrapper>Hi</Wrapper>;
}

export default App;
